import {View, Text, StyleSheet, Image} from "react-native";

const ImageDetail = ({imageScore, title, imageSource}) => {

    return(
        <View>
            <Image source={imageSource}/>
            <Text>{title}</Text>
            <Text>Image score - {imageScore}</Text>
        </View>

    );
}

const styles = StyleSheet.create({

})

